import React from "react";
import ReactLoading from "react-loading";

const Loading = () =>{

	return (
		<div>
			<ReactLoading
				type="spinningBubbles"
				color="secondary"
				height={100}
				width={50}
			/>
		</div>
	);
}

export default Loading;
